function displayPanel(n) {
	if (n == 13) {
		if (t == 0) {
			var i;
			for (i = 0; i < 13; i++) {
				panel[i].style.visibility = "visible";
				plusSign[i].style.display = "none";
				minusSign[i].style.display = "block";
			}
			plusSign[13].style.display = "none";
			minusSign[13].style.display = "block";
			t = 1;
		} else {
			for (i = 0; i < 13; i++) {
				panel[i].style.visibility = "hidden";
				plusSign[i].style.display = "block";
				minusSign[i].style.display = "none";
			}
			plusSign[13].style.display = "block";
			minusSign[13].style.display = "none";
			t = 0;
		}
	} else {
		if (t == 0) {
			panel[n].style.visibility = "visible";
			plusSign[n].style.display = "none";
			minusSign[n].style.display = "block";
			t = 1;
		} else {
			panel[n].style.visibility = "hidden";
			plusSign[n].style.display = "block";
			minusSign[n].style.display = "none";
			t = 0;
		}
	}
}

function showMenu() {
	menuArrow[0].style.display = "none";
	menuArrow[1].style.display = "none";
	var i;
	for (i = 0; i <= 13; i++) {
		menuButton[i].style.width = "300px";
		menuButton[i].style.visibility = "visible";
	}
}

function hideMenu() {
	var i;
	for (i = 0; i <= 13; i++) {
		menuButton[i].style.visibility = "hidden";
		menuButton[i].style.width = "25px";
	}
	menuArrow[0].style.display = "block";
	menuArrow[1].style.display = "block";
}